import Logo from "./componentes/logo/index"
import profile from './img/perfil.svg'
import bag from './img/sacola.svg'
import HeaderOptions from './componentes/headerOptions/index';
const headerIcons = [profile, bag]

function App() {
  return (
    <div className='App'>
      <header className='appHeader'>
      <Logo></Logo>
      <headerOptions></headerOptions>

      <ul className='headerIcons'>
        {headerIcons.map((icon)=> <li className='icon'><img src={icon}></img></li>)}
      </ul>

      </header>
    </div>
    );
}

export default App;
